
--------------------------------------- TEAM ENTRIES ---------------------------------------------------------

CREATE SEQUENCE team_id_seq; 
ALTER TABLE team ALTER COLUMN id SET DEFAULT nextval('team_id_seq');
ALTER SEQUENCE team_id_seq OWNED BY team.id;
SELECT setval('team_id_seq ', COALESCE(max(id), 1)) FROM team;

